import styled from 'styled-components'

export function FormEtapa2() {
    return (
        <div>
            <h1> Etapa 2 - INFORMAÇÕES DO ENSINO SUPERIOR </h1>
            <div>
                <p>5. Qual curso?</p>
                <input type="text"/>
                <p>6. Qual a unidade de ensino?</p>
                <input type="text"/>
            </div>
        </div>
    )
}

export default FormEtapa2;
